import React from 'react';
import styled from 'styled-components';
import LogoContainer from './LogoContainer';

const Styles = styled.div`

background: #eeeeee;
height: 30vh;
`

function Footer() {
   return (
   <Styles>
     <LogoContainer />

   </Styles>
   );
    
    
   
}

export default Footer;
